import {Link} from 'react-router-dom';
// import { Logos } from "../styledComponents/TopMenu.js";
import styled from "styled-components";

/*.##........#######...######....#######...######.
  .##.......##.....##.##....##..##.....##.##....##
  .##.......##.....##.##........##.....##.##......
  .##.......##.....##.##...####.##.....##..######.
  .##.......##.....##.##....##..##.....##.......##
  .##.......##.....##.##....##..##.....##.##....##
  .########..#######...######....#######...######.*/
import StonedColdDreamery from '../photo_assets/Logos/StonedColdDreamery.png';
import SCD_Cone from '../photo_assets/Logos/SCD_Cone.png';

const Logos = styled.div`
  list-style: none;
  display: flexbox;  
  // flex-flow: row wrap;  
  // justify-content: flex-start;
`;

const Cone = styled.img`
    width: 20px;
    height: 20px;
`

const LogoTray=()=> {
    return (
        <Logos>
            <ul>
                <li>
                    <Link to='/'>
                        <Cone>
                            <a src={StonedColdDreamery} alt=""/>
                        </Cone>

                    </Link>
                    SCD-Initials
                </li>
                <li>
                    <Link to='/'><img src={SCD_Cone} alt=""/></Link>
                    SCD-cone
                </li>
                <li>
                    <Link to='/'>
                        <img src="" alt=""/>
                        Stoned Cold Dreamery
                    </Link>

                </li>
            </ul>
        </Logos> 
    )
};

export default LogoTray;
